import React, { Component } from "react";

class Bestselling extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: this.props.res,
    };
  }

  render() {
    return <div>You earned{props.totalRev}</div>;
  }
}

export default Bestselling;
